import {Link} from 'react-router-dom'

export default function NotFound() {	
	return (
		<div className="wrapper">
			<h1>404 | Not Found</h1><br/>
			<h1>404 | Not Found</h1><br/>
			<Link to='/'>Back to Home page</Link>
		</div>
	)
}
